import React, { useState } from "react";
import MoreVertIcon from "@material-ui/icons/MoreVert";
import OptionInnerModal from "./OptionInnerModal";
import { IOption } from "./appFolder-Interfaces";
import {
  Paper,
  Grid,
  Typography,
  makeStyles,
  createMuiTheme,
  MuiThemeProvider,
} from "@material-ui/core";
import "./Option.css";

function Option({ darkmode, switchsize }: any): JSX.Element {
  var useStyle = makeStyles((themeGeneralSettings) => ({
    AppPaperStyle: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        borderRadius: "0px",
        height: "400vh",
        textAlign: "center",

        backgroundImage: darkmode
          ? "linear-gradient(0deg, #282c34, #282c36, #191919 )"
          : "linear-gradient(0deg,  rgb(220,225,225), rgb(255,255,255),rgb(246,250,255) )",
      },
    },
    PaperStyle: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        backgroundImage: darkmode
          ? "linear-gradient(0deg, #282c34, #282c36, #191919 )"
          : "linear-gradient(0deg,  rgb(220,225,225), rgb(255,255,255),rgb(246,250,255))",
      },
    },

    icon: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        objectFit: "contain",
        width: "84%",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        objectFit: "contain",
        width: "84%",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        objectFit: "contain",
        width: "60%",
        transition: " 0.5s transform ease-in",
        cursor: "pointer",
      },
      "&:hover": {
        transition: "560ms transform ease-in",
        transform: "scale(1.06)",
      },
      "&:active": {
        transition: "200ms transform ease-in",
        transform: "scale(0.94)",
      },
    },

    superstarzText: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        fontFamily: "kaushan_scriptregular",
        fontSize: "3.1vh",
        fontWeight: "bolder",
        transition: "opacity 1.5s",
        textAlign: "left",
        marginLeft: "-3px",
        opacity: textVisible ? "1" : "0",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        fontFamily: "kaushan_scriptregular",
        fontSize: "3.5vw",
        fontWeight: "bolder",
        transition: "opacity 1.5s",
        marginLeft: "-8px",
        opacity: textVisible ? "1" : "0",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        fontFamily: "kaushan_scriptregular",
        fontSize: "2.2vw",

        fontWeight: "bolder",
        transition: "opacity 1.5s",
        opacity: textVisible ? "1" : "0",
      },
    },

    littleText: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        fontSize: "1.8vh",
        marginLeft: "3.5px",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        fontSize: "2.1vw",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        fontSize: "1.05vw",
      },
      transition: "opacity 1.5s",
      fontWeight: "bold",

      color: darkmode ? "#ccccccff" : "#0b111b",
      opacity: textVisible ? "0.92" : "0",
    },

    loginclass: {
      [themeGeneralSettings.breakpoints.up("xs")]: { transform: "scale(0.95)" },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        fontSize: "2vw",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        fontSize: "1vw",
      },
      padding: "11px",
      borderRadius: "50px",
      mozBoxShadow: `0 0 ${appVariables.shade2num}px ${appVariables.shade2} `,
      webkitBoxShadow: `0 0 ${appVariables.shade2num}px ${appVariables.shade2} `,
      boxShadow: `0 0 ${appVariables.shade2num}px ${appVariables.shade2} `,
    },

    signupclass: {
      [themeGeneralSettings.breakpoints.up("xs")]: { transform: "scale(0.95)" },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        fontSize: "2vw",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        fontSize: "1vw",
      },

      padding: "13.3px",
      borderRadius: "50px",
      mozBoxShadow: `0 0 4.5px ${appVariables.shade}`,
      webkitBoxShadow: `0 0 4.5px ${appVariables.shade} `,
      boxShadow: `0 0 4.5px ${appVariables.shade}`,
    },

    optionsContainer: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        padding: "2vh",
        paddingTop: "2.9vh",
        top: "1em",
        fontWeight: "bold",
        display: "flex",
        alignItems: "center",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        padding: "4.5vh",
        top: "1em",
        fontWeight: "bold",
        display: "flex",
        alignItems: "center",
      },
    },
  }));
  const [showModal, setShowModal] = useState<boolean>(false);

  console.log("zerformance issue");

  return (
    <Grid container style={{ position: "fixed", top: "0em" }}>
      jjj
    </Grid>
  );
}

